import React from "react"
import { Container, Row, Col } from "react-bootstrap"

export const Projects = () => {
    const projects = [
        {
            title: "",
            description: "",
            image: "",
            github: ""
        },
    ]
    return (
        <div className="Projects-Container">
            <Container>
                <Row>
                    <Col>
                        <h2 className="Projects-Title">Projects</h2>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}

export default Projects;
